from tkinter import Tk, filedialog, Button, Entry, Canvas, PhotoImage, Label
from PIL import ImageTk, Image
import colorgram 
import sys
import base64
from io import BytesIO


explode = b''


# _______________________________ Functions _____________________________________

def select_func():
	window.attributes('-topmost', True) # Opened windows will be active. above all windows despite of selection.
	open_file = filedialog.askopenfilenames(filetypes=[("Image Files", ".png .jfif, .jpg, .jpeg")]) # Returns opened path as str 
	file_path.delete("0", "end")
	file_path.insert(0, open_file[0])
	

def extract_func():
	global img2
	global picture
	y = file_path.get()
	picture3 = Image.open(y)
	picture3.thumbnail((200, 200))
	img2 = ImageTk.PhotoImage(picture3)
	picture = picture3
	canv.itemconfig(thumb_pic, image=img2)
	color_func()


def rgb_to_hex(rgb):
    return '%02x%02x%02x' % rgb


def color_func():

	colors = []
	colors_1 = colorgram.extract(picture, 10)

	for _ in colors_1:
	    r = _.rgb.r
	    g = _.rgb.g
	    b = _.rgb.b
	    color = (r, g, b)
	    colors.append(color)


	rows = 3

	for i in range(len(colors)):
		a = rgb_to_hex(colors[i])
		color_pallete = Button(text="", padx=20, bg="#{}".format(a))
		color_pallete.grid(column=2, row=rows, pady=2)
		color_hex = Label(text="#{}".format(a))
		color_hex.grid(column=1, row=rows)
		color_rgb = Label(text="{}".format(colors[i]), bg="#C2DED1")
		color_rgb.grid(column=0, row=rows)
		rows += 1



#______________________________________ GUI _____________________________________

window = Tk()
window.config(padx=25, pady=50, bg="#C2DED1")
window.minsize(width=550, height=600)
window.maxsize(width=650, height=700)
window.title("Hemo Color Extraction program")


#_____________________________ Choose Image File Path ___________________________

open_file_button = Button(text="Select File", command=select_func, padx=20)
open_file_button.grid(column=0, row=0, padx=50)

file_path = Entry(width=40)
# file_path.insert(0, 'newtext is this knw emwe ')
file_path.grid(column=1, row=0, columnspan=2)

operate = Button(text="Extract Colors", command=extract_func, padx=50)
operate.grid(column=1, row=1, pady=15, columnspan=3)


# __________________________ Create Image Thumbnail _____________________________

canv = Canvas(bg="#C2DED1", highlightthickness=0)
canv.grid(column=0, row=2, columnspan=2)

# picture2 = Image.open("logo.png")
# picture2.thumbnail((200, 200))
img2 = None  # ImageTk.PhotoImage(picture2)



byte_data = base64.b64decode(explode)
image_data = BytesIO(byte_data)
picture1 = Image.open(image_data)
picture1.thumbnail((200, 200))
img = ImageTk.PhotoImage(picture1)

thumb_pic = canv.create_image(50, 50, image=img, anchor='nw')


# _________________________ Color Pallets ______________________________

picture = picture1

color_func()



window.mainloop()


